<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>404</title>
    <style>
        body,h1,h2,h3,h4,h5,h6,hr,p,blockquote,dl,dt,dd,ul,ol,li,pre,form,fieldset,legend,button,input,textarea,th,td {
            margin: 0;
            padding: 0
        }

        body,html,input {
            font-size: 12px;
            line-height: 150%;
            font-family: tahoma,arial,sans-serif,"瀹嬩綋";
            color: #333
        }

        table {
            border-collapse: collapse;
            border-spacing: 0
        }

        h1,h2,h3,h4,h5,h6 {
            font-weight: normal
        }

        img {
            border: 0;
            vertical-align: middle
        }

        input,textarea {
            outline: none;
            font-family: Arial,Helvetica,sans-serif
        }

        pre {
            white-space: pre-wrap;
            white-space: -moz-pre-wrap;
            white-space: -pre-wrap;
            white-space: -o-pre-wrap;
            word-wrap: break-word
        }

        input,label,img,th {
            vertical-align: middle
        }

        address,cite,dfn,em,var {
            font-style: normal
        }

        ul,ol,li {
            list-style: none
        }

        .error_box {
            position: relative;
            width: 448px;
            margin: 0 auto;
            margin-top: 108px;
            text-align: right
        }

        .error_box img {
            position: relative;
            width: 90%;
            z-index: 2;
        }

        .error_box .text {
            position: absolute;
            left: 0;
            font-size: 108px;
            line-height: 108px;
            color: #262626;
            opacity: 0.1;
            filter: alpha(opacity = 10);
            z-index: 1;
        }

        .error_con {
            text-align: center;
            color: #666666;
            font-size: 16px;
            margin-top: 45px;
        }

        .error_link {
            font-size: 16px;
            margin-top: 12px;
            text-align: center
        }

        .error_link a {
            color: #365899;
        }

        .error_link a:hover {
            color: #8E2630;
        }

        .header-search-box {
            height: 100px;
            line-height: 100px;
            background: #f2f1ea;
            margin-bottom: 30px;
        }
        .header-search-box img {
            display: inline-block;
            width: 262px;
        }
        .header-search {
            width: 1000px;
            margin: 0 auto;
        }

    </style>
</head>
